  false,\n\t\"url\": null,\n\t\"notes\": \"File contains Ba/Ca data (in mmol/mol)
  presented by Lea et al. (1989). Samples were measured at the Massachusetts Institute
  of Technology by D. Lea. Ba determinations were performed on a VG PlasmaQuad inductively
  coupled plasma mass spectrometer, and Ca was determined by flame atomic absorption.
  Measurement precision is 1% for Ba/Ca. Ages for samples were assigned on the basis
  of well-defined density banding. Annual growth averaged 11mm/yr.\",\n\t\"license_title\":
